import React from "react";
import classes from './PortfolioItem2.module.css';

let PortfolioItem2 = (props) => {



    return(
        <div className={classes.block}>
                <div className={classes.item}>
                    <img src={props.img}alt=""/>
                </div>
        </div>
    );
};
export default PortfolioItem2;
